package com.krushna.Java_rnd.neetcode.slidingWindow;

import java.util.HashMap;
import java.util.Map;

/**
 * https://leetcode.com/problems/minimum-window-substring/description/
 * 
 * 
 * Given two strings s and t of lengths m and n respectively, return the minimum
 * window
 * 
 * of s such that every character in t (including duplicates) is included in the
 * window. If there is no such substring, return the empty string "".
 * 
 * The testcases will be generated such that the answer is unique.
 * 
 * 
 * 
 * Example 1:
 * 
 * Input: s = "ADOBECODEBANC", t = "ABC" Output: "BANC" Explanation: The minimum
 * window substring "BANC" includes 'A', 'B', and 'C' from string t.
 * 
 * Example 2:
 * 
 * Input: s = "a", t = "a" Output: "a" Explanation: The entire string s is the
 * minimum window.
 * 
 * Example 3:
 * 
 * Input: s = "a", t = "aa" Output: "" Explanation: Both 'a's from t must be
 * included in the window. Since the largest window of s only has one 'a',
 * return empty string.
 * 
 * 
 * 
 */

public class MinimumWindowSubstring {
	
	/**
	 * Here we will take another optimisation approach
	 * We can create the tcountMap and reuse it for matching
	 * 
	 * Plus doing a every time match, we can do some optimisation here by maintaining have count.
	 *  Refer this
	 */
	
	public static String minWindowV2(String s, String t) {

		// base case
		if (s.isEmpty())
			return s;

		if (s.length() == 1 && t.length() == 1) {
			return t.contains(s) ? s : "";
		} else if (s.length() == 1 && t.length() > 1) {
			return "";
		}

		// create the t count map

		Map<Character, Integer> tcountMap = new HashMap<>();
		for (char c : t.toCharArray()) {
			tcountMap.put(c, tcountMap.getOrDefault(c, 0) + 1);
		}

		int p1 = 0;
		int p2 = 0;
		Map<Character, Integer> windowMapCount = new HashMap<>();
		int minSize = Integer.MAX_VALUE;
		String subString = "";
		int have = 0;

		while (p1 < s.length() && p2 < s.length()) {

			// optimisation if the substring length is less then given return empty
			if (t.length() > s.length() - p1) { // no point of checking break it
				break;
			}

			// more optimisation, we need to store only character which are part of
			// TcountMapt
			char c = s.charAt(p2);
			Integer tcount = tcountMap.getOrDefault(c, 0);

			// we should consider this char
			if (tcount != 0) {
				windowMapCount.put(c, windowMapCount.getOrDefault(c, 0) + 1);
				// then we got what we should have or not
				int windowCount = windowMapCount.get(c);
				if (windowCount == tcount) {
					have++;
				}

				// we have now what is need, this subString can be minimum one, so check and
				// store it
				// move the pointer to next position and remove the count for the char, and
				// reduce the have also.
				// if the char is there then only we should change the have else no need.
				// we can run a loop still we are valid

				while (have == tcountMap.size() && p1 <= p2) {
					char rc = s.charAt(p1);
					if (minSize > (p2 + 1) - p1) {
						subString = s.substring(p1, p2 + 1);
						minSize = subString.length();
					}
					int rcCount = tcountMap.getOrDefault(rc, 0);
					if (rcCount != 0) {
						windowMapCount.put(rc, windowMapCount.get(rc) - 1);
						// this should be done only the count become less
						if (windowMapCount.get(rc) < rcCount)
							have--;
					}
					p1++;

				}
			}
			++p2;
		}
		return subString;
	}
	
	
	/**
	 * Ultra-optimized version with reduced cognitive complexity and better performance
	 * Uses character arrays for ASCII characters (0-127) for O(1) access
	 */
	public static String minWindowV3(String s, String t) {
		if (s.isEmpty() || t.isEmpty() || s.length() < t.length()) {
			return "";
		}
		
		// Use arrays for better performance with ASCII characters
		int[] targetCount = new int[128];
		int[] windowCount = new int[128];
		int requiredChars = 0;
		
		// Build target frequency array
		for (char c : t.toCharArray()) {
			if (targetCount[c] == 0) requiredChars++;
			targetCount[c]++;
		}
		
		int left = 0;
		int minStart = 0;
		int minLen = Integer.MAX_VALUE;
		int formedChars = 0;
		
		for (int right = 0; right < s.length(); right++) {
			char rightChar = s.charAt(right);
			windowCount[rightChar]++;
			
			// Check if current character frequency matches target
			if (targetCount[rightChar] > 0 && windowCount[rightChar] == targetCount[rightChar]) {
				formedChars++;
			}
			
			// Contract window
			while (formedChars == requiredChars && left <= right) {
				if (right - left + 1 < minLen) {
					minStart = left;
					minLen = right - left + 1;
				}
				
				char leftChar = s.charAt(left);
				windowCount[leftChar]--;
				if (targetCount[leftChar] > 0 && windowCount[leftChar] < targetCount[leftChar]) {
					formedChars--;
				}
				left++;
			}
		}
		
		return minLen == Integer.MAX_VALUE ? "" : s.substring(minStart, minStart + minLen);
	}
	
	
	
	
	

	public static String minWindow(String s, String t) {
		// base case
		if(s.isEmpty())
			return s;
		
		if(s.length() ==1 && t.length() ==1) {
			return t.contains(s) ? s:"";
		}else if(s.length() ==1 && t.length() >1) {
			return "";
		}
		
		if(s.length() < t.length()) {
			return "";
		}
		
		
		int p1=0;
		int p2=p1;
		int minSubStringLength=Integer.MAX_VALUE;
		String minSubString="";
		
		while(p1 < s.length()  && p2 < s.length()) {
			// optimisation if the substring length is less then given return empty
			if(t.length() > s.length()-p1) { // no point of checking  break it
				break;
			}
			String subString=s.substring(p1, p2+1);
			// optimisation
			if(subString.length() < t.length()) {
				p2++;
				continue;
			}
			
			//System.out.println(subString);
			if(checkv2(subString, t)) {
				p1++;
				p2=p1;
				if(minSubStringLength > subString.length()) {
					minSubStringLength=subString.length();
					minSubString=subString;
				}
			}else {
			p2++;
			}
		}
		return minSubString;

	}
	
	/**
	 * Not only character match, their count also needs to be match
	 * example check ("a", "aa") should return false, so what we can once matched found we can
	 * removed the character
	 * @param subString
	 * @param t
	 * @return
	 */
	public static boolean check(String subString, String t) {
		StringBuilder sb= new StringBuilder(subString);
		for(char c: t.toCharArray()) {
			int index=sb.indexOf(String.valueOf(c));
			
			if(index == -1) // char does not exist
				return false;
			// remove the matched char
			else {
				sb.deleteCharAt(index);
			}
		}
		return true;
	}
	
	// match count this time
	public static boolean checkv2(String subString, String stringTocheck) {
		// create the count map then check for matching. we can use single and do the minus for 
		// each char, and we should be able to minus each char.
		
		Map<Character, Integer> subStringCount= new HashMap<Character, Integer>();
		
		
		for(char c: subString.toCharArray()) {
			subStringCount.put(c, subStringCount.getOrDefault(c, 0)+1);
		}
		for(char c: stringTocheck.toCharArray()) {
			int count=subStringCount.getOrDefault(c,0);
			if(count==0) {
				return false;
			}else {
				subStringCount.put(c, count-1);
			}
		}
		return true;
		
		
	}
	
	
	
	public static void main(String[] args) {
		System.out.println(minWindowV2("ADOBECODEBANC", "ABC"));
		System.out.println(minWindowV2("ab", "a"));
		System.out.println(minWindowV2("a", "aa"));
		
		//System.out.println(minWindowV2(
		//		"",
		//		""));
	}
	

}
